import {useParams} from 'react-router-dom';

import Button from '@material-ui/core/Button';
import Api from '../../../services/api';




export default function ValidationEmail() {
  
  const {tokenUsuario} = useParams();

  async function hundleSub(){
    try {
      const response = await Api.post(`activate/${tokenUsuario}`);
      if(response === 200){
        alert('Cadastro validado!')
        window.location.href= '/';
      }
     
    } catch (error) {
      const { data } = error.response;
      alert(data.message);
    }
    
  }
  
  return (
    <form >
      <h2 className='subtitle'>Confirme seu cadastro</h2>
      <Button onClick={hundleSub} fullWidth  variant="contained" color="secondary">
        Confirmar cadastro
      </Button>
    </form>
    
  );
}
